import React, { Component } from 'react';
import './ochain.css';
import Pf from './pf.png'
import  { Button } from 'mdbreact';

class Mainapp extends Component {
    render() {
      return (
        <div>
        <div className='greybox z-depth-5 border border-light'>

           <h6 className='text-center' >Produto</h6>

           <h5 className='text-center font-weight-bold '>Vitamina A- Z</h5>
        <hr/>
            <p> Produto original do paraná, com composição: olho de soja, extrato de leite, ovo de codorna destilado. 
            Produto original do paraná, com composição: olho de soja, extrato de leite, ovo de codorna destilado. 
            </p>
        </div>

<div className='greybox z-depth-5 border border-light'>

<h6 className='text-center'>Propriedade</h6>
<h5 className='text-center font-weight-bold '>Estevan Pedro W. R.</h5>

<div className='text-center'>
<img width="100px" src={Pf} alt='profile_photo'  className="rounded-circle" /><br/>
</div>
<hr/>
<a>Usuário: estevanpwr</a><br/>
<a>CNPJ/CPF: 059.292.829-27</a><br/>
<a>E-mail: estevanpwr@outlook.com</a><br/>
<hr/>
<div className='text-center'><Button size="sm" >Histórico</Button></div>
</div>
        </div>
      );
    }
  }

export default Mainapp;
